import Budget from "../../components/Budget";
import AboutYourself from "../../components/AboutYourself";

export default function Home() {
  const appState = useContext(StateContext);
  /*
  if (!appState.loggedIn) {
    useEffect(() => {
      Router.replace("/signup");
    }, []);

    return <></>;
  }
  */
  return (
    <>
      <CNavbarBlueNoOp />
      <Container>
        <AboutYourself />
      </Container>
    </>
  );
}
